function Aero = ParamDef_UltraStick25e_Aero(Aero, T_S2SB)
% Remarks:
% ALL stability derivative units are radians.
% Forces are defined in the Wind frame, Moments in the Body frame

switch lower(Aero.type)
    case {'avl_v1'}
        Aero = US25e_AVL_v1();
    case {'flight', 'old'}
        Aero = US25e_flight_v1(); % Established Aero PID derived from flight data with Thor using Goldy 1.
    otherwise
        
end

% Transform S frame to SB frame
Aero.rAero_SB_m = T_S2SB * Aero.rAero_S_m;

end

function Aero = US25e_flight_v1()
%% Geometric Parameters
% Aerodynamic center is Origin of the Aero Frame (force application point)
Aero.rAero_S_m = [0.2175; 0; 0.046];
Aero.T_Aero2W = [-1, 0, 0; 0, 1, 0; 0, 0, -1]; % Rotation Transform from Aero Frame to Wind Frame

% Mean aerodynamic chord [m]
Aero.c = 0.25;

% Wing span [m]
Aero.b = 1.27;

% Wing area [m^2]
Aero.S = 0.3097;

% Wing Aspect Ratio [m^2]
Aero.AR = Aero.b^2 / Aero.S;

%% Aero Model Conditions
% Breakpoint Definitions
Aero.velBkPts = [10:10:40];
Aero.alphaBkPts = (-4:2:10) * pi/180;
Aero.betaBkPts = (-10:5:10) * pi/180;

Aero.breakPts = {Aero.velBkPts, Aero.alphaBkPts, Aero.betaBkPts};
Aero.breakDesc = {'velocity_mps', 'alpha_rad', 'beta_rad'};

sizeArray = [length(Aero.velBkPts), length(Aero.alphaBkPts), length(Aero.betaBkPts)];

% Flow Conditions

% Trim Conditions


%% Aero Table Setup
% Stability Table Fields, Sequence must match Simulink Model
Aero.stabFields = {'zero', 'alpha', 'beta', 'alphaDot', 'betaDot', 'pHat', 'qHat', 'rHat'};
Aero.stabDragFields = {'vis', 'osw'};

% Control Surfaces, Sequence must match that defined in Effector Subsystem
Aero.cntrlFields = {'delev', 'drud', 'dailL', 'dailR', 'dflapL', 'dflapR'};

% Setup Lookup Tables
depList = [Aero.stabFields{2:end}, Aero.cntrlFields]; % Dependency vector, used to back compute the 'zero' term

% Dimension of the result of the table lookup
Aero.tableDim = length(Aero.breakPts) + 1;


%% Lift coefficient
Aero.CL.tot = repmat(0.23, sizeArray);
Aero.CL.zero = repmat(0.1086, sizeArray);
Aero.CL.alpha = repmat(4.58, sizeArray);
Aero.CL.beta = repmat(0, sizeArray);
Aero.CL.alphaDot = repmat(0 * 1.9724, sizeArray); % Defined, but not used in the Previous Simulation
Aero.CL.betaDot = repmat(0, sizeArray);
Aero.CL.pHat = repmat(0, sizeArray);
Aero.CL.qHat = repmat(6.1639, sizeArray);
Aero.CL.rHat = repmat(0, sizeArray);
Aero.CL.dflapR = repmat(0.5 * 0.7400, sizeArray);
Aero.CL.dailR = repmat(0.5 * 0.4751, sizeArray);
Aero.CL.dailL = Aero.CL.dailR;
Aero.CL.dflapL = Aero.CL.dflapR;
Aero.CL.delev = repmat(0.0983, sizeArray);
Aero.CL.drud = repmat(0, sizeArray);

%% Drag coefficient (CD = CD_vis + (CL - CL_minD)^2 / (pi*AR*osw) + CD_surf)
Aero.CD.vis = repmat(0.0434, sizeArray);
Aero.CD.osw = repmat(0.75, sizeArray);
Aero.CD.dflapR = repmat(0.5 * 0.1467, sizeArray);
Aero.CD.dailR = repmat(0.5 * 0.0302, sizeArray);
Aero.CD.dailL = Aero.CD.dailR;
Aero.CD.dflapL = Aero.CD.dflapR;
Aero.CD.delev = repmat(0.0135, sizeArray);
Aero.CD.drud = repmat(0.0303, sizeArray);

Aero.CL.minD = Aero.CL.tot; % This works because this model is a single condition

%% Side Force coefficient
Aero.CY.zero = repmat(0, sizeArray);
Aero.CY.alpha = repmat(0, sizeArray);
Aero.CY.beta = repmat(-0.4889, sizeArray);
Aero.CY.alphaDot = repmat(0, sizeArray);
Aero.CY.betaDot = repmat(0, sizeArray);
Aero.CY.pHat = repmat(-0.0375, sizeArray);
Aero.CY.qHat = repmat(0, sizeArray);
Aero.CY.rHat = repmat(0.1500, sizeArray);
Aero.CY.dflapR = repmat(0.5 * 0, sizeArray);
Aero.CY.dailR = repmat(0.5 * 0, sizeArray);
Aero.CY.dailL = -Aero.CY.dailR;
Aero.CY.dflapL = -Aero.CY.dflapR;
Aero.CY.delev = repmat(0, sizeArray);
Aero.CY.drud = repmat(0.1913, sizeArray);

%% Roll moment coefficient
Aero.Cl.zero = repmat(0, sizeArray);
Aero.Cl.alpha = repmat(0, sizeArray);
Aero.Cl.beta = repmat(-0.0545, sizeArray);
Aero.Cl.alphaDot = repmat(0, sizeArray);
Aero.Cl.betaDot = repmat(0, sizeArray);
Aero.Cl.pHat = repmat(-0.4496, sizeArray);
Aero.Cl.qHat = repmat(0, sizeArray);
Aero.Cl.rHat = repmat(0.1086, sizeArray);
Aero.Cl.dflapR = repmat(0.5 * -0.0692, sizeArray);
Aero.Cl.dailR = repmat(0.5 * -0.1646, sizeArray);
Aero.Cl.dailL = -Aero.Cl.dailR;
Aero.Cl.dflapL = -Aero.Cl.dflapR;
Aero.Cl.delev = repmat(0, sizeArray);
Aero.Cl.drud = repmat(0.0115, sizeArray);

%% Pitch moment coefficient
Aero.Cm.zero = repmat(-0.0278, sizeArray);
Aero.Cm.alpha = repmat(-0.7230, sizeArray);
Aero.Cm.beta = repmat(0, sizeArray);
Aero.Cm.alphaDot = repmat(0, sizeArray);
Aero.Cm.betaDot = repmat(0, sizeArray);
Aero.Cm.pHat = repmat(0, sizeArray);
Aero.Cm.qHat = repmat(-13.5664, sizeArray);
Aero.Cm.rHat = repmat(0, sizeArray);
Aero.Cm.dflapR = repmat(0.5 * 0.0467, sizeArray);
Aero.Cm.dailR = repmat(0.5 * 0.0467, sizeArray);
Aero.Cm.dailL = Aero.Cm.dailR;
Aero.Cm.dflapL = Aero.Cm.dflapR;
Aero.Cm.delev = repmat(-0.8488, sizeArray);
Aero.Cm.drud = repmat(0, sizeArray);

%% Yaw moment coefficient
Aero.Cn.zero = repmat(0, sizeArray);
Aero.Cn.alpha = repmat(0, sizeArray);
Aero.Cn.beta = repmat(0.0723, sizeArray);
Aero.Cn.alphaDot = repmat(0, sizeArray);
Aero.Cn.betaDot = repmat(0, sizeArray);
Aero.Cn.pHat = repmat(0.1180, sizeArray);
Aero.Cn.qHat = repmat(0, sizeArray);
Aero.Cn.rHat = repmat(-0.1833, sizeArray);
Aero.Cn.dflapR = repmat(0.5 * 0.0214, sizeArray);
Aero.Cn.dailR = repmat(0.5 * 0.0574, sizeArray);
Aero.Cn.dailL = -Aero.Cn.dailR;
Aero.Cn.dflapL = -Aero.Cn.dflapR;
Aero.Cn.delev = repmat(0, sizeArray);
Aero.Cn.drud = repmat(-0.1811, sizeArray);

%% Aero Tables
coefList = {'CL', 'CY', 'Cl', 'Cm', 'Cn'};
[Aero] = GenAeroTable(Aero, coefList, Aero.stabFields, Aero.cntrlFields);
[Aero] = GenAeroTable(Aero, {'CD'}, Aero.stabDragFields, Aero.cntrlFields);
end


